pragma solidity ^0.5.0;

import "openzeppelin-solidity/contracts/token/ERC20/ERC20.sol";
import "openzeppelin-solidity/contracts/token/ERC20/ERC20Detailed.sol";

contract Token is ERC20, ERC20Detailed {
  uint256 startTime;
  uint256 endTime;
  constructor(uint256 _startTime, uint256 _endTime, uint256 initialSupply) ERC20Detailed("Gold", "GLD", 18) public {
    _mint(msg.sender, initialSupply);
    startTime = _startTime;
    endTime = _endTime;
  }

  function _transfer(address recipient, uint256 amount) public returns (bool) {
    // require(now >= startTime && now < endTime, "Must take place within the given time window");
    super._transfer(msg.sender, recipient, amount);
    emit Transfer (msg.sender, recipient, amount);
    return true;
  }
}
